function init(){for(var e=0;e<localStorage.length;e++){var n=localStorage.key(e);"note"===n.substring(0,6)&&addStickiesToPage(localStorage.getItem(n))}}function addStickiesToPage(e){var n=document.getElementById("note-"),t=document.createElement("li"),i=document.createElement("span");i.setAttribute("class","note"),i.innerHTML=e,t.appendChild(i),n.appendChild(t)}function showSpinner(){$(".taskHandler").show()}function hideSpinner(){$(".taskHandler").hide()}window.onload=init;
